import { Component, OnInit } from '@angular/core';
import { AuthService } from 'src/app/service/auth.service';

@Component({
  selector: 'app-lab-results',
  templateUrl: './lab-results.component.html',
  styleUrls: ['./lab-results.component.css']
})
export class LabResultsComponent implements OnInit{

  testResults: any[] = []

  constructor(private authSrv : AuthService){}

  ngOnInit(): void {
    let id = localStorage.getItem('id')
    this.authSrv.getPatientLabResultsById(id).subscribe(data => {
      this.testResults = data
      console.log(this.testResults);

    })
  }

}
<h2>Test Results List</h2>

<div *ngFor="let testResult of testResults" class="test-result-item">
  <div class="test-result-detail">
    <p><strong>Result ID:</strong> {{ testResult.ResultID }}</p>
    <p><strong>Test ID:</strong> {{ testResult.TestID }}</p>
    <p><strong>Patient ID:</strong> {{ testResult.PatientID }}</p>
    <p><strong>Doctor ID:</strong> {{ testResult.DoctorID }}</p>
    <p><strong>Result Details:</strong> {{ testResult.ResultDetails }}</p>
    <p><strong>Result Date:</strong> {{ testResult.ResultDate | date:'medium' }}</p>
    <p><strong>Test Name:</strong> {{ testResult.Name }}</p>
  </div>
</div>
